import React from 'react'

export default function Home() {
    return (
        <div className="bk">
        <div>
          
          <h1 className="Hometitle"> Think before you speak.<br/> Read before you think </h1>
          <p> Welcome to our page ,<br/> We'll show you diffrent types of books! </p>

        </div>
        <img src="https://s3-eu-west-1.amazonaws.com/tra-src/uploads/asset/file/345/WWH_Page_Breaker_No_1.png"/>
        
        </div>
    )
}
